import { useState, useEffect } from 'react';
import { useRouter } from 'next/router';
import Head from 'next/head'; 
import { FormProvider } from "@/Context/FormContext";
import { TabProvider } from "@/Context/TabContext";
import "@/styles/globals.css";
import { AuthProvider } from "@/Context/AuthContext";
import { PageProvider } from "@/Context/PageContext";
import { FilterProvider } from "@/Context/FilterContext";
import { SchemeProvider } from "@/Context/schemeContext";
import { BookmarkProvider } from "@/Context/BookmarkContext";
import { SortProvider } from '@/Context/SortContext';
import { PreferenceProvider } from "@/Context/preferenceContext";
import { PrivacyProvider } from '@/Context/PrivacyContext';
import RedirectHandler from "@/components/ComponentsUtils/RedirectHandler";
import { PrimeReactProvider } from "primereact/api";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

import { ProfileProvider } from "@/Context/ProfileContext";


export default function App({ Component, pageProps }) {
  const [loading, setLoading] = useState(false); 
  const [isFirstLoad, setIsFirstLoad] = useState(true);
  const router = useRouter();


  const checkSession = () => {
    const expiryTime = localStorage.getItem("sessionExpiry");

    if (expiryTime && new Date().getTime() > expiryTime) {
      localStorage.clear();
      alert("Session expired! Please log in again.");
      router.push("/login");
    }
  };

  
  
  useEffect(() => {
    checkSession(); 
    const interval = setInterval(checkSession, 30000); 
    return () => clearInterval(interval); 
  }, []);

  // Handle page transition events
  useEffect(() => {
    const handleStart = () => {
      if (!isFirstLoad) {
        setLoading(true); // Show loader during navigation
      }
    };
    const handleComplete = () => {
      setLoading(false); // Hide loader after navigation is complete
      setIsFirstLoad(false); // After the first load, we show loader on subsequent transitions
    };

    // Adding event listeners for page transitions
    router.events.on('routeChangeStart', handleStart);
    router.events.on('routeChangeComplete', handleComplete);
    router.events.on('routeChangeError', handleComplete);

    // Cleanup event listeners on component unmount
    return () => {
      router.events.off('routeChangeStart', handleStart);
      router.events.off('routeChangeComplete', handleComplete);
      router.events.off('routeChangeError', handleComplete);
    };
  }, [router, isFirstLoad]);

  return (
    <>
      {/* Add a Head tag for global metadata */}
      <Head>
        <title>Empower Hub</title>
<link rel="icon" href="/_next/static/media/favicon.e9847d9a.ico" type="image/x-icon" />      </Head>

      <ToastContainer />

      {loading && (
        <div className="fixed inset-0 bg-white flex flex-col items-center justify-center z-50">
          {/* Logo */}
          <svg
          width="50"
          height="50"
          viewBox="0 0 50 50"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <rect width="50" height="50" fill="url(#pattern0_924_1236)" />
          <defs>
            <pattern
              id="pattern0_924_1236"
              patternContentUnits="objectBoundingBox"
              width="2"
              height="2"
            >
              <use
                href="#image0_924_1236"
                transform="translate(0 -0.00123762) scale(0.00123762)"
              />
            </pattern>
            <image
              id="image0_924_1236"
              width="820"
              height="820"
              href="data:image/png;base64,
                
                
                
                
                
                
                
                
                
                "
            />
          </defs>
        </svg>
          {/* Loading Dots */}
          <div className="flex space-x-2">
            <div className="w-3 h-3 bg-blue-800 rounded-full animate-bounce" style={{ animationDelay: '0s' }}></div>
            <div className="w-3 h-3 bg-blue-800 rounded-full animate-bounce" style={{ animationDelay: '0.2s' }}></div>
            <div className="w-3 h-3 bg-blue-800 rounded-full animate-bounce" style={{ animationDelay: '0.4s' }}></div>
          </div>
        </div>
      )}
    <SortProvider>
      <PreferenceProvider>
        <FilterProvider>
          <PageProvider>
            <TabProvider>
              <AuthProvider>
                <SchemeProvider>
                  <FormProvider>
                    <PrimeReactProvider>
                      <BookmarkProvider>
                        <ProfileProvider>
                        <PrivacyProvider>
                        <div className="flex flex-col min-h-screen">
                          {/* Main Content */}
                          <div className="flex-grow">
                            {/* <RedirectHandler /> */}
                            <Component {...pageProps} />
                          </div>
                        </div>
                        </PrivacyProvider>
                        </ProfileProvider>
                      </BookmarkProvider>
                    </PrimeReactProvider>
                  </FormProvider>
                </SchemeProvider>
              </AuthProvider>
            </TabProvider>
          </PageProvider>
        </FilterProvider>
      </PreferenceProvider>
    </SortProvider>
    </>
  );
}
